import React from 'react';
import './Galeria.css';

const Galeria = (props) =>{
    function kattKez(adat){
        props.kattKez(adat)
    }
    return(
        <div className='galeria'>
        {props.adatok.map((elem, id) => {
        <Kartya obj={elem} key={id} kattKez={kattKez}/>
        })}
    </div>
    );
};

export default Galeria;
